function App() {

  const [shleves, setShelves] = useState (
    [
      { id: 1, name: "Currently Reading"},
      { id: 2, name: "Want to Read"},
      { id: 3, name: "Read"}
    ]
  );

  return (
    <Routes>
        <Route exact path="/" element={<MyLibrary></MyLibrary>} />
        <Route exact path="/search" element={<SearchBooks></SearchBooks>} />
    </Routes>
  );
}

export default App;
